import React from 'react';

/*images*/
import ReactLogo from '../src/icons/LogoAlpha.svg';

export default function Header() {
    return(
        <header>
            <div className="logo-upper">
                <img src={ReactLogo} alt="React Logo" />
            </div>
        </header>
    )
}
